// build the first part of your ML model pipeline:
// - assembling the data features (hint: Spark ML pipelines provides the transformer "VectorAssembler" for that)
// - scaling the features (hint: Spark ML pipelines provides the transformer "StandardScaler" for that)

import org.apache.spark.ml.{Pipeline, PipelineModel}
import org.apache.spark.ml.feature.{VectorAssembler, StandardScaler}

// assemble your data into features
val assembler = (new VectorAssembler()
    .setInputCols(data.columns.toArray)
    .setOutputCol("features"))

// scale your features
val scaler = (new StandardScaler()
    .setInputCol(assembler.getOutputCol)
    .setOutputCol("scaledFeatures")
    .setWithStd(true)
    .setWithMean(true))

// build the second part of your ML model pipeline:
// - add a k-means model that uses your scaled features as last step (hint: Spark ML pipelines provide as the estimator "KMeans" to do that)
// - assemble all the steps into one ML pipeline

import org.apache.spark.ml.{Pipeline, PipelineModel}
import org.apache.spark.ml.clustering.{KMeans, KMeansModel, BisectingKMeans, BisectingKMeansModel}

var errorTuples = List[(Int, Float)]()
var errorTuplesBisect = List[(Int, Float)]()

for (K <- 2 to 15) {

    // put the scaled features into a k-means estimator
    val kmeans = (new KMeans()
        .setK(K)
        .setFeaturesCol(scaler.getOutputCol))

    val kmeansBisect = (new BisectingKMeans()
        .setK(K)
        .setFeaturesCol(scaler.getOutputCol))


    // assemble your pipeline
    val pipeline = (new Pipeline()
        .setStages(Array(assembler, scaler, kmeans)))

    val pipelineBisect = (new Pipeline()
        .setStages(Array(assembler, scaler, kmeansBisect)))


    // after building the pipeline:
    // - fit the pipeline on your training data
    // - calculate the training and test error of your pipeline (hint: the fitted KMeans model provides a convenient function to directly calculate the clustering-error of a data set)

    // fit the pipeline to get your model
    val model = pipeline.fit(data)
    val modelBisect = pipelineBisect.fit(data)

    // cluster your data with the fitted model
    val clusteredData = model.transform(data)
    val clusteredDataBisect = modelBisect.transform(data)

    // calculate the clustering cost
    val cost = model.stages.last.asInstanceOf[KMeansModel].computeCost(clusteredData)
    val costBisect = modelBisect.stages.last.asInstanceOf[BisectingKMeansModel].computeCost(clusteredDataBisect)

    errorTuples = errorTuples :+ (K, cost.asInstanceOf[Float])
    errorTuplesBisect = errorTuplesBisect :+ (K, costBisect.asInstanceOf[Float])

    println("done: k = " + K)

}

// as soon as the pipeline above is working, put a for-loop around to iterate over it and calculate the cost for different values of k
// then build a DataFrame of the results, register it for SQL access and visualize k vs. cost with the built-in Zeppelin SQL tools

val errorDataFrame = errorTuples.toDF("k", "error")
errorDataFrame.createOrReplaceTempView("kmeansError")

val errorDataFrameBisect = errorTuplesBisect.toDF("k", "error")
errorDataFrameBisect.createOrReplaceTempView("kmeansErrorBisect")
